/// Returns a reference to the value at the supplied `index`.
///
/// ***Panics*** if `index` is out of bounds.

cond_chains.ret:
self.get_index(index)
            .unwrap_or_else(|| {
                panic!(
                    "index out of bounds: the len is {len} but the index is {index}",
                    len = self.len()
                );
            })
            .1
